Hello friends and followers of @worldoflabs. This account, which I created more than 4 years ago, was hacked since December 25th by @worldofcutepugs owners, but I can happily say that I have recovered my account as of today. I'm sorry for the inconveniences this may have caused you. As most of you could have detected, the fake "iPhone giveaway" and the multiple features that the hackers came up with to benefit their Pug account, are totally unlike the way I conduct this page. 
For your information, the other accounts associated with their dishonest business are:
@daily_combat
@worldofcutepugs 
I take this opportunity to wish you well for the coming year. ❤️

